  selector: 'app-category-detail',
  templateUrl: './category-detail.component.html',
  styleUrls: ['./category-detail.component.scss']
})
export class CategoryDetailComponent {
  category!: ICategory;
  products!: any;
  product!: any
  test: any[] = []

  constructor(
    private route: ActivatedRoute,
